    try {
      const res = axios.get("/books");
      console.log(res);
    } catch (e) {
      console.log(e);
    }
  };
  useEffect(() => {
    getBooks();
  }, []);
  const books = [
    {
      name: "hermes",
      birthDay: "2021-04-03T03:00:00.000Z",
      date: "2021-04-24T02:15:00.000Z",
      id: 2,
    },
    {
      name: "Débora Borba Prazim",
      birthDay: "2021-04-03T03:00:00.000Z",
      date: "2021-04-25T17:15:00.000Z",
      id: 3,
    },
    {
      name: "Gabriela",
      birthDay: "2000-11-09T03:00:00.000Z",
      date: "2021-04-15T02:30:00.291Z",
      id: 4,
    },
  ];
  return (
    <div>
      <Table>
        <thead>
          <tr>
            <th>Nome</th>
            <th>idade</th>
            <th>Vacinação</th>
          </tr>
        </thead>
      </Table>
    </div>
  );
}

export default BookList;
